func GetStreamIDsByTagID(id int64) []int64 {
	return streamTagsPool[id]
}

func GetTagIDsByStreamID(id int64) []int64 {
	tagIDs := []int64{}
	for tagID, streams := range streamTagsPool {
		for _, streamID := range streams {
			if streamID == id {
				tagIDs = append(tagIDs, tagID)
			}
		}
	}
	return tagIDs
}
